/**
 * STATS GRID
 * This module builds a call center stats grid using settings from StatsGridSettings.
 * By default, stats are refreshed in an interval of 60 seconds, except for the callers waiting
 *
 * @requres StatsGridSettings
 * @returns public entry to init method.
 **/

var StatsGrid = (function() {

    /**
     * local settings variables accessible across module methods
     */
    var s = {
        settings: null,
        queue: null
    };

    /**
     * initializes the stats grid. to load stats and build the grid
     *
     * @param {integer} interval - a number in ms for the refresh interval.
     **/
    var init = function(interval) {
        StatsGridSettings.init();

        s.queue = $.localStorage.get('statsGridQueue');

        if (typeof s.queue == 'undefined' || s.queue == 'null')
            s.queue = null;

        if (typeof interval == 'undefined' || isNaN(interval))
            interval = 60000;

        // s.settings = StatsGridSettings.load();

        loadStats();

        setInterval(loadStats, interval);
    },

    /**
     * grabs current stats grid settings, shows the loading animation and rebuilds the stats grid.
     **/
    reBuildGrid = function() {

        $('#dash-stats-body').html('<div class="loading-container relative" style="top:0px;padding: 50px 0;">' +
			'<div class="loading-spinner la-ball-spin-clockwise">' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
				'<div></div>' +
			'</div>' +
		'</div>');

        loadStats();
    },

    /**
     * loads the current stats and then updates or builds the stats grid to show them
     **/
    loadStats = function() {
        //make sure settings are the latest
        s.settings = StatsGridSettings.load();

        /*if ($.localStorage.get('statsGridDomain') ==  sub_domain)
            s.queue = $.localStorage.get('statsGridQueue');
        else
            s.queue = null;*/
        s.queue = null;

        var multiple = false;
        var queueSelectCount =0;
        $("#manager_queues .graph-checkbox").each(function() {
            if($(this).is(':checked')) {
                queueSelectCount++;
                if (s.queue == null)
                    s.queue = $(this).data('graphname');
                else
                {
                    multiple = true;
                    s.queue = s.queue+","+$(this).data('graphname');
                }


            }

        });


        var url = '/portal/callqueues/statsummary?';
        var sla =  $.localStorage.get('reports_sla_time');

        $.localStorage.set('statsGridQueueChecked',null);


        if (multiple)
        {
            url += "queue_list="+s.queue+"&";
        }
        else if (typeof s.queue !== 'undefined' && s.queue != null && s.queue != '')
        {
            url += "queue="+s.queue+"&";
            $.localStorage.set('statsGridQueueChecked',"|"+s.queue);
        }

        $.localStorage.set('statsGridQueueCheckedCount',queueSelectCount);


        if (typeof sla == 'undefined' || sla == null || sla == '')
            sla =60;

        url += "sla="+sla;

        $.getJSON(url, function(data) {
            log('Stats Grid: loading stats data from ' + url);
            log(data);
            if($('.dash-stats-grid-table').length)
                updateGrid(data);
            else
                buildGrid(data);
        })
        .fail(function() {
            log( "Stats Grid: statsummary fail" );
        })
        .always(function() {
            log( "Stats Grid: statsummary complete" );
        });
    },

    /**
     * builds the stats grid table structure and then updates the grid with stat data.
     *
     * @param {object} data is the stats data object retrieved from loadStats
     **/
    buildGrid = function(data) {
        log('StatsGrid: buildGrid');
        //grab stats
        var statsBody = $('#dash-stats-body');
        var statShown = false;

        statsBody.empty();

        $.each(s.settings, function(i, stat) {
            if(stat.show) {
                var html = statHtml(stat);

                statsBody.append(html);

                statShown = true;
            }
        });

        if(!statShown)
            $('#dash-stats-body').html('<p class="muted text-center">Please select a stat to show in "settings".</p>');
        else
        {
          updateGrid(data);
          if(typeof $(document).popover == 'function')
        	{
        			var opts = {
        					trigger: 'hover',
        					placement: 'top',
        					template: '<div class="popover"><div class="arrow"></div><div class="popover-inner"><h3 class="popover-title"></h3><div class="popover-content"><p></p></div></div></div>',
        					container: 'body',
        					html: true,
        					delay: { show: 200, hide: 0 }
        			};
        			$('#dash-stats-body .label-popover.popover-stats').popover(opts);
        	}
        }

    },

    /**
     * updates the stats grid with stat data. colors each stat accordingly
     *
     * @param {object} data is the stats data object retrieved from loadStats
     **/
    updateGrid = function(data) {
        log('StatsGrid: updateGrid');

        $('.dash-stats-data-row td').each(function(){
            var gridStat = $(this).data('grid-stat');
            var statId = $(this).attr('id');
            var error = false;
            var val;

            try {
                if (gridStat == "CW") {
                    cwSum();
                    return true;
                } else {
                    if($.localStorage.isSet('statsGridQueueChecked') && $.localStorage.get('statsGridQueueChecked')!=null)
                        val = parseFloat(data[$.trim($.localStorage.get('statsGridQueueChecked')).replace(/^\|+|\|+$/g, '')][gridStat]);
                    else
                        val = parseFloat(data['*'][gridStat]);
                }
            } catch (e) {
                log('Stats Grid: ERROR parsing data');
                log(e);
                error = true;
            }

            if(!error) {

                changeStatColor(statId, val);

                if (gridStat == "ABN" ||gridStat == "SL" )
                {
                    val = val + "%";
                }
                else if (gridStat == "AHT" || gridStat == "AWT") {
                    var m = Math.floor(val/60);
                    var s;

                    if (val < 60)
                        s = val;
                    else
                        s = val%60;

                    val = m+":"+(s < 10 ? '0'+s : s);
                }
            } else {
                val = "<span title='No data'>&ndash;</span>";
            }

            //set the value in the corresponding grid cell
            $(this).html(val);

        });
        //alert($.trim($.localStorage.get('statsGridQueueChecked')).replace(/^\|+|\|+$/g, ''));
        if($.localStorage.isSet('statsGridQueueCheckedCount') && $.localStorage.get('statsGridQueueCheckedCount')==0)
            $('#stats-grid-queue-label').text(_('All Queues'));
        else if($.localStorage.isSet('statsGridQueueChecked') && $.localStorage.get('statsGridQueueChecked')!=null)
            $('#stats-grid-queue-label').text($.trim($.localStorage.get('statsGridQueueChecked')).replace(/^\|+|\|+$/g, ''));
        else if($.localStorage.isSet('statsGridQueueCheckedCount') && $.localStorage.get('statsGridQueueCheckedCount')>0)
        {
            $('#stats-grid-queue-label').text($.localStorage.get('statsGridQueueCheckedCount')+' '+_('Queues'));
        }
    },

    /**
     * shows an alert at the top of the stats grid
     *
     * @param {string} msg is the message text to show in the alert
     **/
    gridAlert = function(msg) {
        var statsBody = $('#dash-stats-body');
        var html = '<div class="alert">'+
                        '<button type="button" class="close" data-dismiss="alert">&times;</button>'+
                        msg +
                    '</div>';

        statsBody.prepend(html);
    },

    /**
     * totals the number of callers waiting and updates the stat in the stats grid
     **/
    cwSum = function() {
        log('Stats Grid: calculating callers waiting');

        var statId = "dash-stats-grid-cw";
        var value;
        var sum = 0;
        // iterate through each td based on class and add the values

        if($.localStorage.get('statsGridQueueCheckedCount')>1 || ($.localStorage.isSet('statsGridQueueChecked') && $.localStorage.get('statsGridQueueChecked')!=null) )
        {
          $("#manager_queues .graph-checkbox").each(function() {
              if ($(this).is(':checked'))
              {
                value = $(this).parent().parent().find(".queuelength").text();
                // add only if the value is number
                if (!isNaN(value) && value.length !== 0) {
                  sum += parseFloat(value);

                  }
              }
          });
        }
        else
        {
          $(".queuelength").each(function() {

            value = $(this).text();
            // add only if the value is number
            if (!isNaN(value) && value.length !== 0) {
                sum += parseFloat(value);
              }});
        }

        log("CW : "+ sum);
        changeStatColor(statId, sum);

        $('#' + statId).text(sum);
    },

    /**
     * totals the number of callers waiting and updates the stat in the stats grid
     *
     * @param {string} stat is the object for an individual stat
     * @returns {string} html is the table html for an individual stat in the stats grid
     **/
    statHtml = function(stat) {
        log(stat);
        var desc = '';
        var subDesc = '';

        if (typeof stat.invert == 'undefined')
            stat.invert="no";
            var help='';
        if (typeof(titles_supervisor[stat.abbr]) != 'undefined' && typeof(descriptions_supervisor[stat.abbr][0]) != 'undefined')
        {
            desc = descriptions_supervisor[stat.abbr][0];

            if (typeof(descriptions_supervisor[stat.abbr][1]) != 'undefined')
                subDesc = descriptions_supervisor[stat.abbr][1];

            help = '<span class="label-popover popover-stats" data-title="'+titles_supervisor[stat.abbr]+'"  data-content="'+desc+'<p>'+subDesc+'</p>"><i class="icon-info-sign"></i></span>';
        }
        var html = '<table class="dash-stats-grid-table">' +
                    '<tbody>'+
                        '<tr class="dash-stats-label-row">'+
                            '<td title="'+stat.title+'">'+stat.abbr+help+ '</td>'+
                        '</tr>'+
                        '<tr class="dash-stats-data-row">'+
                            '<td id="dash-stats-grid-'+stat.abbr.toLowerCase()+'" data-grid-invert="'+stat.invert+'" data-grid-stat="'+stat.abbr+'" data-grid-stat-upper-limit="'+stat.values.upper+'" data-grid-stat-lower-limit="'+stat.values.lower+'"></td>'+
                        '</tr>'+
                    '</tbody>'+
                '</table>';

        return html;
    },

    /**
     * changes the stat color background based on the current value and its ratio to the thresholds
     *
     * @param {string} statId is the object for an individual stat
     * @param {number} val is the object for an individual stat
     **/
    changeStatColor = function(statId, val) {
        var pct = 0;
        var upperLimit = $('#' + statId).data('grid-stat-upper-limit');
        var lowerLimit = $('#' + statId).data('grid-stat-lower-limit');
        var lowerLimitPct;
        var invert = false;

        if ("yes"==$('#' + statId).data('grid-invert'))
            invert=true;

        if(!upperLimit && !lowerLimit) {
            $('#' + statId).css({
                'border': '1px solid #eee',
                'box-sizing':'border-box',
                '-moz-box-sizing':'border-box',
                '-webkit-box-sizing':'border-box'
            });
        } else {


            val = parseFloat(val);
            lowerLimitPct = lowerLimit/upperLimit;

            if (invert)
            {

            	if (upperLimit && 100-val !== 0)
                    pct = (100-val)/(100 -upperLimit);
                else
                    pct = 0;
            }
            else
        	{
            	 //if there is no upper limit, use lowerlimit for percent
                if (upperLimit && val !== 0)
                    pct = val/upperLimit;
                else if (lowerLimit)
                    pct = val/lowerLimit;
                else
                    pct = 0;
        	}





            if (invert)
                log(statId+ pct);
            // log(Stats Grid: " + statId + " pct: " +pct);
            // log(Stats Grid: " + statId + " lowerLimitPct: " +lowerLimitPct);

            var pctColors = setColorObj(lowerLimitPct);

            var color = getPctColor(pct, pctColors);
            // log("color: "+color);
            $('#' + statId).animate({
                backgroundColor: color
            }, 200);
        }
    },

    /**
     * calulates the stat color based on percent of threshold
     *
     * @param {number} pct is the percent of the stat value versus the threshold
     * @param {object} pctColors is an object of colors with associated percents
     **/
    getPctColor = function(pct, pctColors) {
        var arrayLength = pctColors.length;
        var lastColors;

        if (pct > pctColors[arrayLength-1].pct) {
                lastColors = pctColors[arrayLength-1];

                return 'rgb(' + [lastColors.color.r, lastColors.color.g, lastColors.color.b].join(',') + ', 0.6)';
        }
        else if (pct === 0) {
                lastColors = pctColors[0];

                return 'rgb(' + [lastColors.color.r, lastColors.color.g, lastColors.color.b].join(',') + ', 0.6)';
        }
        else
            for (var i = 0; i < arrayLength; i++) {
                    if (pct <= pctColors[i].pct) {
                            var lower = pctColors[i - 1];
                            var upper = pctColors[i];
                            var range = upper.pct - lower.pct;
                            var rangePct = (pct - lower.pct) / range;
                            var pctLower = 1 - rangePct;
                            var pctUpper = rangePct;
                            var color = {
                                    r: Math.floor(lower.color.r * pctLower + upper.color.r * pctUpper),
                                    g: Math.floor(lower.color.g * pctLower + upper.color.g * pctUpper),
                                    b: Math.floor(lower.color.b * pctLower + upper.color.b * pctUpper)
                            };
                            return 'rgb(' + [color.r, color.g, color.b].join(',') + ', 0.6)';
                            // or output as hex if preferred
                    }
            }
    },

    /**
     * creates the colors object that matches color to a percent value.
     *
     * @param {number} lowerLimitPct is the percent calculated from the lower threshold and upper threshold
     * @returns {object} pctColors is an object of colors with associated percents
     **/
    setColorObj = function(lowerLimitPct) {
        var pctColors;

        if (typeof lowerLimitPct == 'undefined' || !lowerLimitPct || lowerLimitPct >= 1.0)
            lowerLimitPct = 0.7;

        pctColors = [
            { pct: 0.0, color: { r: 0x00, g: 0xff, b: 0 } },
            { pct: lowerLimitPct, color: { r: 0xff, g: 0xff, b: 0 } },
            { pct: 1.0, color: { r: 0xff, g: 0x00, b: 0 } }
        ];

        return pctColors;
    };

    /**
     * public methods
     */
    return {
        init: init,
        load: loadStats,
        rebuild: reBuildGrid,
        cw: cwSum,
        alert: gridAlert
    };


})();

/**
 * AUDIO PLAYER
 * This module builds HTML5 audio player
 *
 * @returns public entry to buildPlayer,playButton, downloadButton, and bindUIActions
 **/

var AudioPlayer = (function() {

    /**
     * binds events to audio player and play button.
     *
     * @param {number} i helps identify the audio player
     */
    var bindUIActions = function(i) {
        var $audio = $('#audio-player-' + i );
        var $playtoggle = $('#playtoggle-' + i );
        var title = 'Play';

        $audio.on('play',function() {
            $playtoggle.tooltip('hide');
            $playtoggle.addClass('waiting');
            $playtoggle.attr('title', '');
            $playtoggle.attr('data-original-title', _('Loading'));
        }).on('playing', function() {
            $playtoggle.tooltip('hide');
            $playtoggle.removeClass('waiting');
            $playtoggle.addClass('playing');
            $playtoggle.attr('title', '');
            $playtoggle.attr('data-original-title', _('Stop'));
        }).on('pause ended', function() {
            $playtoggle.tooltip('hide');
            $playtoggle.removeClass('playing');
            $playtoggle.removeClass('waiting');
            $playtoggle.attr('data-original-title', title);
            $audio[0].load();
        });

        $playtoggle.click(function() {
            if ($audio[0].paused) {
                $audio[0].play();
            }
            else {
                $audio[0].pause();
            }
        });
    },

    /**
     * builds the HTML5 audio element with source paths. combines with the playbutton.
     *
     * @param {string} path is the URL used for the source of the audio file
     * @param {integer} i is the integer to help identify the audio player
     * @param {string} extraClass is an HTML class that is passed on to the play button HTML
     * @returns {string} playerHtml is the combined audio elements and play button
     */
    buildPlayer = function(path, i, extraClass){
        path = cleanPath(path);

        var ogg = path + "&convert=ogg",
            aac = path + "&convert=aac",
            wav = path + "&convert=signed";

        var playerHtml = '<audio id="audio-player-' + i + '"" preload="none">' +

                '<source id="audio-player-' + i +'-wav-1" src="' + wav + '" type="audio/x-wav" >' +
                '<source id="audio-player-' + i +'-wav-2" src="' + ogg + '" type="audio/ogg; codecs=vorbis">' +
                '<source id="audio-player-' + i +'-wav-3" src="' + aac + '" type="audio/mp4" >' +
                '<source id="audio-player-' + i +'-aac-1" src="' + aac + '" type="audio/aac" >' +

        '</audio>';

        var playHtml = playButton(path, i, extraClass);

        playerHtml += playHtml;

        return playerHtml;
    },

    /**
     * builds the HTML5 audio element with source paths. combines with the playbutton.
     *
     * @param {string} path is the URL used for the source of the audio file
     * @param {integer} i is the integer to help identify the audio player
     * @param {string} extraClass is an HTML class that is passed on to the play button HTML
     * @returns {string} playHtml is the combined the play button
     */
    playButton = function(path, i, extraclass){
        var playHtml = '<span id="playtoggle-' + i +'" class="play helpsy '+extraclass+'" title="Play"></span>';

        return playHtml;
    },

    /**
     * build the download button
     *
     * @param {string} path is the URL used for the source of the audio file
     * @returns {string} buttonHtml is the download button html
     */
    downloadButton = function(path){
        path = cleanPath(path);

        path += "&convert=signed";

        var buttonHtml = "<a class='download-audio helpsy' title='Download' target='_blank' href='"+path+"'></a>";

        return buttonHtml;
    },

    /**
     * removes html characters from path and changes replaces localhost with server name
     *
     * @returns {string} path is the URL used for the source of the audio file
     */
    cleanPath = function(path){
        var server = checkServer();

        path = path.replace(/\b&amp;\b/g, '&');
        path = path.replace('localhost', server);

        return path;
    },

    /**
     * determines server name and replaces localhost with corp (for development purposes)
     */
    checkServer = function() {
        var server = window.location.hostname;

        if (server =="localhost")
            server = "corp.netsapiens.com";

        return server;
    };

    /**
     * public methods
     */
    return {
        build: buildPlayer,
        playButton: playButton,
        downloadButton: downloadButton,
        bind: bindUIActions
    };


})();

/**
 * NETSAPIENS search and sort contacts module based on NSAgentSearch OMP-56
 * Used in Contacts dock.ctp and popout.ctp
 *
 * @requires jquery-1.8.3.mins.js
 * @requires NSPresenceSearchSort module
 * @returns {object} public methods
 */
var NSContactSearch = (function () {
    var sortTimerSet =false;
    /**
     * initialize NSAgentSearch
     */
    var init = function(actionsId, tableId) {
        // Get localStorage sort_type value
        var local = $.localStorage.get('contacts_sort_type_'+actionsId);

        // Set sortType value if local falsy or undefined "Last Name", else local value
        var sortType = (!local || typeof local === "undefined") ? "Last Name" : local;

        // Translate and display sortType
        var sortTypeText = $('#' + actionsId + ' .contacts-sortby-toggle').find('[data-contacts-sort-type="' + sortType + '"]').text();
        $('#' + actionsId + ' .contacts-current-sortby').text(sortTypeText);

        _resetContacts(tableId);
        _sortContactsTable(actionsId, tableId);
        _bindUIActions(actionsId, tableId);
    },

    /**
     * bind listeners for sortings, search string entry, and show/hide toggle of search field
     */
    _bindUIActions = function(actionsId, tableId) {
        log('NSContactSearch._bindUIActions');

        var $inputBox = $('#' + actionsId + ' .contacts-searchbox-input');
        var $searchBox = $('#' + actionsId + ' .contacts-searchbox');
        var $searchDropToggle = $('#' + actionsId + ' .contacts-sort-dropdown .dropdown-toggle');
        var $searchBoxIcon = $('#' + actionsId + ' .contacts-searchbox-icon span');

        var isOpen = false;

        /* select sort option */
        $('#' + actionsId + ' .contacts-sortby-toggle a').on('click', function(){
            var sortTypeText = $(this).text();
            var sortType = $(this).data('contacts-sort-type');
            var sortOrder = $(this).data('contacts-sort-order');
            var previousSortType = $.localStorage.get('contacts_sort_type_'+actionsId);
            var previousSortOrder = $.localStorage.get('contacts_sort_order_'+actionsId);

            if( previousSortType == sortType ) sortOrder = previousSortOrder == 'desc' ? 'asc' : 'desc'; /// reverse order when sorting by same type

            $.localStorage.set('contacts_sort_type_'+actionsId,sortType);
            $.localStorage.set('contacts_sort_order_'+actionsId,sortOrder);
            $('#' + actionsId + ' .contacts-current-sortby').text(sortTypeText);

            _sortContactsTable(actionsId, tableId);

            return true;
        });

        /* read search string after each key press */
        $inputBox.on('keyup', function() {
            _resetContacts();
        });

        /* toggle the search field */
        $('#' + actionsId + ' .contacts-searchbox-icon').click(function(){

            if(isOpen == false)
            {
                $searchBox.addClass('searchbox-open');
                $inputBox.focus();
                $searchDropToggle.fadeTo('fast', 0);
                $searchBoxIcon.removeClass('iconfont-search').addClass('iconfont-remove');

                /* set height of scroll container so it doesn't shift when searching */
                $('.dock-contacts .scroll-container').css('height', function(){
                    return $(this).height();
                })

                isOpen = true;
            }
            else
            {
                $searchBox.removeClass('searchbox-open');
                $inputBox.attr('placeholder', '')
                         .val('')
                         .focusout();
                $searchDropToggle.fadeTo('fast', 1);
                $searchBoxIcon.removeClass('iconfont-remove').addClass('iconfont-search');
                _resetContacts(undefined, true);

                /* remove height of scroll container */
                $('.dock-contacts .scroll-container').css('height', '');

                isOpen = false;
            }
        });
    },

    /**
     * after receiving a socket update for contacts, check if user is currently searching their contacts so we don't resort/reset the table.
     * if they're not searching, sort the table
     */
    receivedSocketUpdate = function() {
        var actionsId = 'contacts-sort-search'; // updates only go to dock
        var searchOpen = $('.contacts-searchbox').hasClass('.searchbox-open');
        var sortType = $.localStorage.get('contacts_sort_type_'+actionsId);
        var sortOrder = $.localStorage.get('contacts_sort_order_'+actionsId);

        //only sort from socket update if searchbox isn't open and sort type is Online, and a sort isn't already in progres
        if(!searchOpen && !sortTimerSet && sortType == 'Online')
		{
			sortTimerSet=true;
			sortTimer =setTimeout(function() {
				sortTimerSet=false;
			_sortContactsTable();
			}, 200);
		}
    },

    changedGroup = function(actionsId) {
        _resetContacts();
        var filter = $('#' + actionsId + ' .contact-groups option:selected').val();

        $.cookie('Dock_filter',filter,{expires : 365,path : '/'}); //brought cookie saving over from existing function in node.php
    },

    /**
     * filter contacts using the search string.
     */
    _resetContacts = function(tableId, reset = false) {
        if( typeof tableId == 'undefined' ) tableId = 'contacts-table'; // default is dock contacts

        $('#' + tableId + ' .contact-row').hide();
        var table = document.getElementById(tableId);
        var textfilter = $("#contacts-searchbox-input").val();
        if (reset) {
            //if it is resetting contacts from exit, need to keep current group selected
            var filter = $("#current-group").text();
            if ($("#current-group").attr("data-selected"))
                filter = $("#current-group").attr("data-selected");
        } else {
            //else should filter from all
            var filter = $("#contact-groups option:selected").val();
            if ($("#current-group").attr("data-selected"))
                filter = $("#current-group").attr("data-selected");
        }

        var viewable = false;

        for (var i = 0, row; row = table.rows[i]; i++) {
            var thisRow = $(row);

            if (NSPresenceSearchSort.isItemViewable(filter, textfilter, thisRow)) {
                thisRow.show();
                viewable = true;
                $('.nonecreated-contacts').hide();
            }
        }

        if (!viewable) {
            var message = $('.nonecreated-contacts h5');

            if (textfilter) {
                message.text(_('No contacts matched your search for') + ' "' + textfilter + '".');
            }
            else {
                message.text(_('No contacts found.'));
            }

            $('.nonecreated-contacts').show();
        }
    },

    /**
     * sort contacts table based on selected sort option
     */
    _sortContactsTable = function(actionsId, tableId) {
        if( typeof actionsId == 'undefined' ) actionsId = 'contacts-sort-search'; // default is dock contacts
        if( typeof tableId == 'undefined' ) tableId = 'contacts-table'; // default is dock contacts

        log('NSContactSearch._sortContactsTable');

        var rows = $('#' + tableId + ' .contact-row').get();
        var sortType = $.localStorage.get('contacts_sort_type_'+actionsId);
        var sortOrder = $.localStorage.get('contacts_sort_order_'+actionsId);

        if (sortType == null) sortType = "Extension";
        if (sortOrder == null) sortOrder = "asc";

        rows = NSPresenceSearchSort.sortRows(rows, sortType, sortOrder);

        $.each(rows, function(index, row) {
            $('#'+tableId).children('tbody').append(row);
        });
    };

    return {
        init: init,
        receivedSocketUpdate: receivedSocketUpdate,
        changedGroup: changedGroup
    };

})();

/**
 * NETSAPIENS search or sort any contacts/agents table
 *
 * @requires jquery-1.8.3.mins.js
 * @returns {object} public methods
 */
var NSPresenceSearchSort = (function() {

    /**
     * Determines if item (table row) should show up in search results
     *
     * @param {string} filter is the Contacts Group that was selected for filter with
     * @param {string} textfilter is the string of text that the user input to search
     * @param {object} thisRow is the row element being checked against the textfilter
     * @returns {boolean} true if the row is visible, false if it isn't
     */
    var isItemViewable = function(filter, textfilter, thisRow ) {
        var isViewable = false;

        // this gets flipped from Offline to inactive somewhere, but they're analogous
        if (filter == 'inactive')
            filter = 'Offline';

        if(typeof String.prototype.trim !== 'function') {
            String.prototype.trim = function() {
                return this.replace(/^\s+|\s+$/g, ''); //add IE support for trim()
            }
        }

        filter = filter.trim();

        if (filter=="All")
            isViewable = true;
        else if (filter=="My Contacts" )
        {
            if ((typeof(thisRow.attr("uid")) == "undefined" || thisRow.attr("uid")=="") && (thisRow.attr("shared")!="true" && thisRow.attr("shared")!="1"))
                isViewable = true;
        }
        else if (filter=="Favorites" )
        {
            if (typeof(thisRow.attr("fav")) != "undefined")
                if (thisRow.attr("fav")=="1")
                    isViewable = true;
        }
        else if (filter=="Coworkers" && thisRow.attr("uid")!="")
        {
            isViewable = true;
        }
        else if (filter=="Available")
        {
            if (thisRow.attr("presence") =="open")
                isViewable = true;
        }
        else if (filter=="Offline")
        {
            if (thisRow.attr("presence") =="inactive")
                isViewable = true;
        }
        else if (filter=="Busy" )
        {
            if (thisRow.attr("presence") =="inuse")
                isViewable = true;
            if (thisRow.attr("presence") =="closed")
                isViewable = true;
            if (thisRow.attr("presence") =="progressing")
                isViewable = true;
            if (thisRow.attr("presence") =="alerting")
                isViewable = true;
        }
        else if (filter == "Shared" )
        {
            if (thisRow.attr("shared")=="true" || thisRow.attr("shared")=="1")
                isViewable = true;
        }
        else
        {
            if (thisRow.attr("department") == filter) {
                isViewable = true;
            }
            if (thisRow.attr("site") == filter) {
                isViewable = true;
            }
        }

        if (typeof(textfilter) != "undefined"
            && textfilter != "Enter a name or extension"
            && textfilter != "Enter a name or extension "
            && textfilter != ""
            && textfilter != " "
        ) {
            // only apply text filter if item is currently visible
            if (isViewable) {
                isViewable = _checkTextfilter(textfilter, thisRow);
            }
        }

        return isViewable;
    },

    /**
     * Compares and sorts entry based on presence, extension or name
     *
     * @param {object} rows contains all of the row elements to be sorted in the table
     * @param {string} sortType is the sort type parameter
     * @returns {object} rows is the sorted object of rows
     **/
    sortRows = function(rows, sortType, sortOrder) {
        log("NSPresenceSearchSort.sortRows");

        if ("Online" == sortType) {
            rows = _sortByOnline(rows, sortOrder);
        } else if ("Extension" == sortType) {
            rows = _sortByExtension(rows, sortOrder);
        } else if ("First Name" == sortType) {
            rows = _sortByName(rows, sortOrder, "firstname");
        } else if ("Last Name" == sortType) {
            rows = _sortByName(rows, sortOrder, "lastname");
        }

        return rows;
    },

    /**
     * Compares row data to search string
     *
     * @param {string} textfilter is the string of text that the user input to search
     * @param {object} thisRow is the row element being checked against the textfilter
     * @returns {boolean} true if it matches, false if it doesn't
     */
    _checkTextfilter = function(textfilter,thisRow) {
        if (typeof(thisRow) == "undefined")
            return false;
        var name = thisRow.attr("name");
        var ext = thisRow.attr("uid");

        if (typeof(name) != "undefined")
        {
            if (name.toLowerCase().indexOf(textfilter.toLowerCase()) !=-1)
                return true;
        }
        if(typeof(ext) != "undefined")
        {
            if (ext.indexOf(textfilter) !=-1)
                return true;
        }
        return false;

    },

    /**
     * Compares and sorts entry based on either first name or last name, depending on type parameter
     *
     * @param {object} rows contains all of the row elements to be sorted in the table
     * @returns {object} rows is the sorted object of rows
     **/
    _sortByOnline = function(rows, sortOrder) {

        rows.sort(function(a, b) {
            var A = "";
            var B = "";

            A = $(a).data("availindex");
            B = $(b).data("availindex");


            if(A === B)
            {
              if (A =="a" )
              {
                if ($(a).find('.onphone').length >0 || $(b).find('.onphone').length >0)
                {
                  if ($(a).find('.onphone').length >0 && $(b).find('.onphone').length ==0)
                    return 1;
                  else if ($(a).find('.onphone').length ==0 && $(b).find('.onphone').length >0)
                    return -1;
                }

              }

                var x = $(a).attr("firstname"),
                    y = $(b).attr("firstname");

                return x < y ? -1 : x > y ? 1 : 0;
            }

            if (A < B)
                return -1;

            if (A > B)
                return 1;

            return 0;
        });

        return sortOrder == 'desc' ? rows.reverse() : rows;
    },

    /**
     * Compares and sorts entry based on extension
     *
     * @param {object} rows contains all of the row elements to be sorted in the table
     * @returns {object} rows is the sorted object of rows
     **/
    _sortByExtension = function(rows, sortOrder) {
        rows.sort(function(a, b) {
            var A = $(a).attr('uid');
            var B = $(b).attr('uid');

            A = A === undefined ? "" : A;
            B = B === undefined ? "" : B;

            A = A.toString();
            B = B.toString();

            if(A === B)
            {
                var x = $(a).attr('lastname');
                    y = $(b).attr('lastname');

                x = x === undefined ? "" : x;
                y = y === undefined ? "" : y;

                if(x && y) {
                  x = x.toString();
                  y = y.toString();
                }

                return _naturalSort(x, y);
            }

            // for when it doesn't have a user/extension
            if (A == "")
              return 1;
            if (B == "")
              return -1;

            return _naturalSort(A, B);
        });

        return sortOrder == 'desc' ? rows.reverse() : rows;
    },

    /**
     * Compares and sorts entry based on either first name or last name, depending on type parameter
     *
     * @param {object} rows contains all of the row elements to be sorted in the table
     * @param {string} type is either firstname or lastname
     * @returns {object} rows is the sorted object of rows
     **/
    _sortByName = function(rows, sortOrder, type) {
        log("_sortByName");
        var secondSort = (type == "firstname" ? "lastname" : "firstname");

        rows.sort(function(a, b) {
            var A = $(a).attr(type);
            var B = $(b).attr(type);

            A = A === undefined ? "" : A;
            B = B === undefined ? "" : B;

            // if first sort is equal, do secondary sort
            if (A == B)
            {
                var X = $(a).attr(secondSort),
                    Y = $(b).attr(secondSort);

                return X < Y ? -1 : X > Y ? 1 : 0;
            }
            else
                return A < B ? -1 : A > B ? 1 : 0;
        });

        return sortOrder == 'desc' ? rows.reverse() : rows;
    },

    /**
     * Ordering of strings in alphabetical order, except that multi-digit numbers are ordered as a single character
     * http://stackoverflow.com/a/15479354
     *
     * @param {string} a - string to compare
     * @param {string} b - string to compare
     * @returns {int}
     **/
    _naturalSort = function(a, b) {
      var ax = [], bx = [];

      a.replace(/(\d+)|(\D+)/g, function(_, $1, $2) { ax.push([$1 || Infinity, $2 || ""]) });
      b.replace(/(\d+)|(\D+)/g, function(_, $1, $2) { bx.push([$1 || Infinity, $2 || ""]) });

      while(ax.length && bx.length) {
          var an = ax.shift();
          var bn = bx.shift();
          var nn = (an[0] - bn[0]) || an[1].localeCompare(bn[1]);
          if(nn) return nn;
      }

      return ax.length - bx.length;
    };;

    return {
        isItemViewable: isItemViewable,
        sortRows: sortRows
    };

})();

