//strip all characters except numbers
function cleanDevicePrep(str) {
    if (typeof str == 'undefined' || str == null)
        return "";

    //make sure str is a string
    if (typeof str !== 'string')
        str = str.toString();

    str = str.replace("sip", "");
    str = str.replace(":", "");
    if (PORTAL_PHONENUMBER_REMOVE_PLUS_ON_CALL) {
        str = str.replace("+", "");
    }
    str = str.replace("(", "");
    str = str.replace(")", "");
    str = str.replace("-", "");
    str = str.replace(/\./g, "");
    str = str.replace(/:/g, "");
    str = str.replace(/ /g, "");
    if (PORTAL_PHONENUMBER_REMOVE_PLUS_ON_CALL) {
        str = str.replace(/\+/g, "");
    }
    str = str.replace(/\(/g, "");
    str = str.replace(/\)/g, "");
    str = str.replace(/-/g, "");
    str = str.replace(/^\s+|\s+$/g, '');
    str = str.replace('wp', '');
    str = str.replace('\"', '');
    str = str.replace(']', '');
    str = str.replace('[', '');
    var group = str.split("@");
    str = group[0];
    str = str.replace("%40", "@");
    var group = str.split("@");
    str = group[0];

    return str;
}

function cleanRemote(str) {
    if (typeof str === 'undefined' || str === null)
        return "";

    str = str.replace("sip", "");
    str = str.replace(":", "");
    str = str.replace("+", "");
    str = str.replace("(", "");
    str = str.replace(")", "");
    str = str.replace("-", "");
    str = str.replace(/\./g, "");
    str = str.replace(/:/g, "");
    str = str.replace(/ /g, "");
    str = str.replace(/\+/g, "");
    str = str.replace(/\(/g, "");
    str = str.replace(/\)/g, "");
    str = str.replace(/-/g, "");
    str = str.replace(/^\s+|\s+$/g, '');

    str = str.replace(/\[/g, "");
    str = str.replace(/\]/g, "");
    str = str.replace(/\"/g, "");

    str = str.replace(new RegExp("@"+sub_domain, "g"), "");

    return str;
}



