function updateAgentDevice(device_aor, huntgroup_name, data) {
	/* Per Queue UI block */
	var queueClass;
	if(data.entry_option == 'immediate' && data.entry_status == 'available') {
		queueClass  = 'open';
		loginStyle  = 'display: none;'; // hide login button, immediate / avail means were logged in
		logoutStyle = 'display: inline-block;'; // show logout button
	}
	else if(data.entry_option == 'manual' && data.entry_status == 'available') {
		queueClass  = 'open';
		loginStyle  = 'display: none;'; // hide login button, immediate / avail means were logged in
		logoutStyle = 'display: inline-block;'; // show logout button
	}
	else if(data.entry_option == 'immediate' && data.entry_status == 'unavailable' && data.session_count > 0) {
		queueClass  = 'inuse';
		loginStyle  = 'display: none;'; // hide login button, immediate / avail means were logged in
		logoutStyle = 'display: inline-block;'; // show logout button
	}
	 else {
		// offline gray, no queueclass
		queueClass  = '';
		loginStyle  = 'display: inline-block;'; // show login button
		logoutStyle = 'display: none;'; // hide logout button
	}
	//console.log(queueClass);
	// jQuery actions
	$('#queue' + huntgroup_name + ' .presence').attr('class', 'agent_status presence ' + queueClass);
	$('#queue' + huntgroup_name + ' button.queue-login').attr('style', loginStyle);
	$('#queue' + huntgroup_name + ' button.queue-logout').attr('style', logoutStyle);
	/* END Per Queue UI block */

	var devId = cleanDevice(device_aor);
	//console.log(devId);
	device_aor = getDevId(device_aor);
	huntgroup_name = getDevId(huntgroup_name);

	var id = "#big-button-group";
	var hg = $(id).data("huntgroup");
	//log(hg);

	homegetStatusButtonNoFade();

	$('.huntgroup_for_device').each(function() {
		if ($(this).data('huntgroup') == huntgroup_name) {
				$(this).data('mode', data.entry_option);
					$(this).data('status', data.entry_status);
		}

	});

}

