Object.size = function(obj) {
    var size = 0, key;
    for (key in obj) {
        if (obj.hasOwnProperty(key)) size++;
    }
    return size;
};

let queuedCallMap = new Map();
const delayedRemoveMap = new Map();
function sGetQueuedData(type, domain, filter) {

	if (typeof socket == 'undefined'){
		log('sGetQueueData: typeof socket undefined');
		return;
	}
	var options = {
		domain : domain,
		type : 'queued',
		'bearer': localStorage.ns_t,
        application: 'portal'
	};

	if (typeof filter != 'undefined' && filter != "" && filter != "*")
		options.filter = filter;

	socket.emit('subscribe', options);
	log(options);
	subscriptions.push(options);

	socket.on('queued', function(data) {
    const sessId = data.session_key + data.queue_name;
    var searchString = "#calls_table.waiting-table tr:gt(0)";
        if (data.remove && data.remove == "yes")
    {
      queuedCallMap.delete(sessId);
      delayedRemove(searchString,data.session_key);
      let newTimeout = setTimeout(delayedRemove,2000,searchString,data.session_key);
      delayedRemoveMap.set(data.session_key,newTimeout );

    }
    else
    {
      queuedCallMap.set(sessId,data);
    }

	});

}


