function sGetVoicemailData(domain, filter) {
    if (typeof socket == 'undefined')
        return;

    var options = {
        domain : domain,
        type : 'voicemail',
        'bearer': localStorage.ns_t,
        application: 'portal'
    };

    if (typeof filter != 'undefined' && filter != "" && filter != "*")
        options.filter = filter;
    else
        return;

    socket.emit('subscribe', options);

    subscriptions.push(options);

    socket.on('voicemail', function(data) {
        log("voicemail socket data received");
        log(data);
        getCount();

    });

}

function getStatus(value) {

    if (value.term_uri == "Call-Queue" || value.term_uri == "Auto-Attendant") {
        return _("Waiting");
    } else {
        if (value.time_answer == "0000-00-00 00:00:00") {
            if (value.by_action && value.by_action == "QueueSDispatch")
              return _("Ringing Agent(s)");
            else
              return _("Ringing Agent");
        } else
            return _("Talking");
    }
}

var lastWaitingSort = Date.now()-2000;
let sortTimeoutID = setTimeout(sortWaitingTable, 250);
function sortWaitingTable() {
  const now = Date.now()-1;

  if (lastWaitingSort+500 > now)
  {
    clearTimeout(sortTimeoutID);
    sortTimeoutID = setTimeout(sortWaitingTable, 250);

    return;
  }



  var table, rows, switching, i, x, y, shouldSwitch;
  table = document.getElementById("calls_table");
  if (!table) return;
  switching = true;
  /*Make a loop that will continue until
  no switching has been done:*/
  while (switching) {
    //start by saying: no switching is done:
    switching = false;
    rows = table.rows;
    /*Loop through all table rows (except the
    first, which contains table headers):*/
    for (i = 1; i < (rows.length - 1); i++) {
      //start by saying there should be no switching:
      shouldSwitch = false;
      /*Get the two elements you want to compare,
      one from current row and one from the next:*/
      x = rows[i];
      y = rows[i + 1];
      if (x.dataset.prioritizedvalue >= y.dataset.prioritizedvalue )
      {
        var d1 = new Date(Date.parse(x.dataset.gmt_start));
        var d2 = new Date(Date.parse(y.dataset.gmt_start));

        if (d1 > d2 || x.dataset.prioritizedvalue > y.dataset.prioritizedvalue)
        {
          shouldSwitch = true;
          break;
        }
      }

      //check if the two rows should switch place:
      // if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
      //   //if so, mark as a switch and break the loop:
      //   shouldSwitch = true;
      //   break;
      // }
    }
    if (shouldSwitch) {
      $('.tooltip').hide();
      /*If a switch has been marked, make the switch
      and mark that a switch has been done:*/
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
    }
  }

  lastWaitingSort = Date.now()-1;
}





