function getType(value, domain, user) {

    if (value.orig_callid.indexOf("adhoc.monitor") !== -1) {
        return "monitor";
    } else if (value.term_callid.indexOf("adhoc.monitor") !== -1) {
        return "monitor";
    } else if (value.term_uri.indexOf("adhoc.monitor") !== -1) {
        return "monitor";
    } else if (value.dnis.indexOf("adhoc.monitor") !== -1) {
        return "monitor";
    } else if (value.term_user == user && value.term_domain == domain) {
        return "inbound";
    } else if (value.by_user == user && value.by_domain == domain) {
        return "inbound";
    } else {
        return "outbound";
    }

}

function getMonitorId(value) {

    var monId = "notmonitored";
    if (value.dnis.indexOf("adhoc.monitor") !== -1) {
        monId = value.dnis;
    } else if (value.orig_callid.indexOf("adhoc.monitor") !== -1) {
        monId = value.orig_callid;
    } else if (value.term_callid.indexOf("adhoc.monitor") !== -1) {
        monId = value.term_callid;
    } else if (value.term_uri.indexOf("adhoc.monitor") !== -1) {
        monId = value.term_uri;
    }

    return monId.replace("callrequest.", "");

}

function isAdhocMonitor(value) {
    return value.orig_callid.includes("adhoc.monitor") || 
           value.term_callid.includes("adhoc.monitor") || 
           value.term_uri.includes("adhoc.monitor");
}

function isDifferentDomain(value) {
    return value.orig_domain !== value.term_domain && 
           value.term_domain !== '*' && 
           value.term_domain !== '' && 
           value.orig_domain !== '*' && 
           value.orig_domain !== '';
}

function getName(value, domain, user, number) {
    if (isAdhocMonitor(value)) {
        return "&nbsp;";
    }

    number = cleanDevicePrep(number);
    if (number.length > 10) {
        number = number.replace(new RegExp("^[" + "1" + "]+"), "");
    }

    if (typeof reversContactLookup !== 'undefined' && reversContactLookup[number]) {
        return reversContactLookup[number];
    }
    if (number.length === 10 && typeof reversContactLookup !== 'undefined' && reversContactLookup["1" + number]) {
        return reversContactLookup["1" + number];
    }

    if (value.orig_domain !== value.term_domain) {
        if (domain === value.orig_domain && user === value.orig_user) {
            return cleanDevice(value.dnis) || "&nbsp;";
        }
        if (domain === value.term_domain && user === value.term_user) {
            return value.orig_name || "&nbsp;";
        }
    }

    if (typeof reverseUserLookup !== 'undefined' && (reverseUserLookup[number] || reverseUserLookup[value.term_sub])) {
        return reverseUserLookup[number] || reverseUserLookup[value.term_sub];
    }

    if (value.term_user === user && value.term_domain === domain) {
        return value.orig_name || value.orig_sub_name || cleanDevice(value.orig_id);
    }
    if (value.by_user === user && value.by_domain === domain) {
        return value.orig_name;
    }
    if (value.orig_from_user !== user) {
        return cleanDevice(value.dnis);
    }
    if (!value.by_user && value.orig_domain === domain) {
        return cleanDevice(value.term_id);
    }

    return "&nbsp;";
}

function getNumber(value, domain, user) {
    if (isAdhocMonitor(value) || isDifferentDomain(value)) {
        return "&nbsp;";
    }

    if (value.term_user === user && value.term_domain === domain) {
        return cleanDevice(value.orig_domain === value.term_domain ? value.orig_match : value.orig_from_uri);
    }

    if (value.by_user === user && value.by_domain === domain) {
        return cleanDevice(value.orig_from_uri);
    }

    if (value.term_match.includes("sip:nms@")) {
        return cleanDevice(value.term_sub);
    }

    return cleanDevice(value.term_uri);
}


