function escapeCallid(callid)
{
  return callid.replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON").replace(":","COLON");
}

function startVideo(ext, session_id = null,type,isScreen, isPremiumVideo = null) {
    //send message over before starting video, for event type chat message
    if(!type)
      type = 'start';
    if(!isScreen)
      isScreen = false;
    
    // only make group dest format if needed
    if (ext.includes(',')) {
        var destArray = ext.split(',');
    } else {
        var destArray = ext;
    }
    var name = $("#namechange-input-"+session_id).val(); //need remote and such
    console.debug(`starVideo called ${PORTAL_VIDEO_ENABLED} ${PORTAL_PREMIUM_VIDEO_ENABLED} | ${PORTAL_VIDEO_ENABLED} ${ext} ${type} ${isScreen}`);

    //OMP-5301 api v2 post for conference create to get meeting_url
    if(PORTAL_PREMIUM_VIDEO_ENABLED || isPremiumVideo) {
        netsapiens.api.v2({ object: 'video', action: 'get' }, `domains/${sub_domain}/users/${sub_user}/video`)
            .then((host) => {
            if( type == 'schedule' ) {
                if(host.iotum_domain){
                    var url = `https://${host.iotum_domain}/auth?host_id=${host.host_id}&login_token_public_key=${host.login_token_public_key}&redirect_url=conf/conferences/schedule`;
                    var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                    var openWin = window.open(url,'_blank',options);
                } else {
                    console.log('Invalid host', host);
                }
                return;
            } else if ( type == 'start') {
                // take in placeholder of video session
                if (session_id == 'xx') {
                    session_id = null;
                }

                if (session_id == null) {
                //generate session_id else API will create an arbitrary one that might not match existing session_id in portal cache message_sessions
                session_id = generateSessionId(sub_domain, null, sub_user+'@'+sub_domain, ext+'@'+sub_domain, null, null, session_id);
                }

                netsapiens.api.v2({ object: 'video', action: 'post', data: { participants: ext } }, `domains/${sub_domain}/users/${sub_user}/video/conference`)
                .then((conference) => {
                    var meeting_room = conference.one_time_access_code ? `/conf/call/${conference.one_time_access_code}` : conference.room_url;
                    var rediect_to = isScreen ? `${meeting_room}?joinScreenShare=true` : meeting_room;
                    var url = `https://${host.iotum_domain}/auth?host_id=${host.host_id}&login_token_public_key=${host.login_token_public_key}&redirect_url=${rediect_to}`;
                    console.log('StartVideo url:', url);
                    var args = {
                        object: 'message',
                        action: 'create',
                        type: 'chat-video-invite',
                        domain: sub_domain,
                        user: sub_user,
                        session_id: session_id,
                        message: conference.room_url,
                        destination: destArray
                    }

                    // do not send a self-message when starting a video conference with just yourself
                    if (ext == sub_user) {
                        var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                        var openWin = window.open(url,'_blank',options);

                        return;
                    }

                    console.log('Video Invite session:', session_id);
                    netsapiens.api.post(args).then(function(){
                        var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                        var openWin = window.open(url,'_blank',options);
                    });
                })
                .catch((e) => {
                    console.error(e);
                });
            }
            return;
            }).catch((e) => {
                console.error('startVideo error:',e);
                return;
            });
    } else if (PORTAL_VIDEO_ENABLED) {
        // this is video meeting with just myself
        if (ext && ext == sub_user) {
            if (type == 'start') {
                let url = 'https://' + server_name + '/video/start';
                var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                var openWin = window.open(url,'_blank',options);
            } else if (type == 'schedule') {
                let url = 'https://' + server_name + '/video/'+type;
                var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                var openWin = window.open(url,'_blank',options);
            }
            return;
        }

        // keep the scheduling, should just open schedule url
        let url = 'https://' + server_name + '/video/'+type;
        if (ext && type == 'schedule')
        {
            url +='?users=' + ext;
            var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
            var openWin = window.open(url,'_blank',options);
            return;
        }

        // take in placeholder of video session
        if (session_id == 'xx') {
            session_id = null;
        }

        if (session_id == null) {
        //generate session_id else API will create an arbitrary one that might not match existing session_id in portal cache message_sessions
        session_id = generateSessionId(sub_domain, null, sub_user+'@'+sub_domain, ext+'@'+sub_domain, null, null, session_id);
        }

        let meetingId = '';
        // get the meeting ID
        var argsCreateMeeting1 = {
            object: 'meeting',
            action: 'create',
            domain: sub_domain,
            user: sub_user,
            getId: 'yes',

        }
        netsapiens.api.post(argsCreateMeeting1).then(function(getIdResObj){
            if (typeof getIdResObj == 'string')
            getIdResObj = JSON.parse(getIdResObj);
            meetingId = getIdResObj.id;

            const attendees = [];
            attendees.push({
                name: sub_name,
                email: sub_email,
                role: 'host',
                uid: sub_user + '@' + sub_domain,
            });
            var createAttendee = {
                object: 'meeting',
                action: 'create',
                format: 'json',
                domain: sub_domain,
                user: sub_user,
                id: meetingId,
                name: '',
                attendees: JSON.stringify(attendees),
            }

            netsapiens.api.post(createAttendee).then(function() {
                //send message for video invite
                var args = {
                    object: 'message',
                    action: 'create',
                    type: 'chat-video-invite',
                    domain: sub_domain,
                    user: sub_user,
                    session_id: session_id,
                    message: meetingId, //doesnt actually appear anywhere, just placeholder
                    destination: destArray
                }
                netsapiens.api.post(args).then(function(){
                    let url = 'https://' + server_name + '/video/?id='+meetingId;
                    if (ext) 
                        url +='&users=' + ext;
                    if (isScreen)
                        url += "&ss=1";
                    var options = 'directories=no,titlebar=no,toolbar=no,location=no,status=no,menubar=no,resizable=no,width=1200,height=900';
                    window.open(url,'_blank',options);
                });
            });
        });
    }
}

