function browser_support_notification()
{
       return window.webkitNotifications;
}

function request_permission()
{
    if (window.webkitNotifications.checkPermission() == 0) {
        } else {
        window.webkitNotifications.requestPermission();
    }
}

function plain_text_notification(image, title, content)
{
    if (window.webkitNotifications.checkPermission() == 0) {
           return window.webkitNotifications.createNotification(image, title, content);
       }
}

var notifyArray = {};
function notifyInbound(callid, cname, number, clean) {
    if ($(window).data("prevType") !="blur")
        return;
    if (window.webkitNotifications) {
        if (typeof notifyArray[callid] != 'undefined')
            return;
        notifyArray[callid] = plain_text_notification("/portal/img/buttons/inbound.png", cname, clean);
        if (typeof notifyArray[callid] == 'undefined')
            return;
        notifyArray[callid].show();
        notifyArray[callid].ondisplay = function(event) {
            setTimeout(function() {
                event.currentTarget.cancel();
            }, 10000);
        };
        notifyArray[callid].onclick = function(event) {
            if (typeof PORTAL_AGENT_SCREEN_POP_URL != "undefined" && PORTAL_AGENT_SCREEN_POP_URL != "")
                window.open("http://www.google.com/?q=" + number, '_blank');
            notifyArray[callid].close();
            notifyArray.splice(callid,1);
        };
    } else {
        log("Notifications are not supported for this Browser/OS version yet.");
    }
}


$(window).on("blur focus", function(e) {

    //log("prevType="+$(window).data("prevType"));

    if ($(window).data("prevType") != e.type) {   //  reduce double fire issues
       switch (e.type) {
            case "blur":
                break;
            case "focus":
                // do work
                break;
        }
    }

    $(window).data("prevType", e.type);
})

