    var popupId = '#' + thisId;
    log('popoutModifyCallsameURI: popupId  ' + popupId);
    var dockBody = popupId + ' .popcall-body';
    var callButtons = popupId + ' .popcall-buttons';
    var callFields = popupId + ' .popcall-fields';
