function getListenButton(value) {

    var vrb = 'activecall'+value.orig_callid.replace(/[^a-zA-Z0-9]/g, '')+""+value.term_callid.replace(/[^a-zA-Z0-9]/g, '')+""+value.term_uri.replace(/[^a-zA-Z0-9]/g, '');
    var jsInsert = "var "+vrb+"=[];";
    jsInsert += ""+vrb+".orig_id='"+value.orig_callid+"';";
    jsInsert += ""+vrb+".term_id='"+value.term_callid+"';";
    jsInsert += ""+vrb+".orig_uri='"+value.orig_uri+"';";
    jsInsert += ""+vrb+".ani='"+value.ani+"';";
    jsInsert += ""+vrb+".term_uri='"+value.term_uri+"';log("+vrb+");"; //hideModal(\'#view-calls\');
    jsInsert += "listenIn("+vrb+");$(this).prop('disabled',true);jsFlash('" + _('Monitoring the Call...') + "');";

    //log(jsInsert);


    if ($('#agents-table').hasClass('allowmonitor')) {
        //log("monitoring allowed");
    }
    else {
        //log("monitoring NOT allowed");
        return "&nbsp;";
    }

    if (value.term_uri == "Call-Queue" || value.term_uri == "Auto-Attendant") {
        return "&nbsp;";
    } else {
        if (value.time_answer == "0000-00-00 00:00:00")
            return "&nbsp;";
        else
            return jsInsert;
    }
}



