function td(str, classStr) {
    if (typeof classStr == 'undefined')
        classStr="";
    return "<td class='"+classStr+"' >" + str + "</td>";
}

function durrationCounter() {
    $('.duration_counter').each(

    function() {
        var gmt_start = $(this).attr('gmt_start');
        var gmt_answer = $(this).attr('gmt_answer');
        if (typeof gmt_answer == "undefined" || gmt_answer == "0000-00-00 00:00:00") {
            if (typeof gmt_start == "undefined" || gmt_start == "0000-00-00 00:00:00" || gmt_start == "") {
                $(this).text("");
            } else
                $(this).text(getDuration(gmt_start, timeOffset));
        } else if (gmt_answer == "ignore")
            $(this).text(getDuration(gmt_start, timeOffset));
        else
            $(this).text(getDuration(gmt_answer, timeOffset));
    });
    return;

}

