// calculates height of dock columns and overlay based on window height
function dockHeight() {
    var dockDivs = $('.dock-overlay-inner, .dock-column, .dock-column-inner');

    dockDivs.height($(window).height());
}

//checks the width of the window and dock-popup-overlay to show or hide popups
function checkPopupWidth() {
    var overlayWidth = $('.dock-popup-overlay').outerWidth(true);
    var windowWidth = $(window).width();

    if(overlayWidth == windowWidth) {
        // hide the last chatbox -- should this only hide chat boxes and not calls?
        $('.dock-popup-overlay .dock-column:visible').last().hide();
    }
    //check if overlay has room to show another chat box
    else if ((overlayWidth + 270) <  windowWidth) {
        $('.dock-popup-overlay .dock-column:hidden').first().show();
    }
}

